function FicheEmployer() {
  return (
    <div
      className="col-12 mt-4   bg-body"
      style={{
        height: "1000px",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    >
          <h3 style={{textAlign:"center", paddingTop:"100px"}}>Fiche Professionnel</h3>
    </div>
  );
}
export default FicheEmployer;
